                'lastAprilMonday'       : new Date(year,  3, lastWeekdayOfMonth(3, 1)),
                'lastAprilFriday'       : new Date(year,  3, lastWeekdayOfMonth(3, 5)),
                'lastOctoberFriday'     : new Date(year,  9, lastWeekdayOfMonth(9, 5)),
